import React, { Component } from 'react'

export default class login extends Component {
    render() {
        return (
            <div>
                <div><a href='http://localhost:8080/api/auth/logout'>Logout</a></div>
                <div><a href='http://localhost:8080/api/auth/login'>Login</a></div>
                <div><a href='http://localhost:8080/api/auth/login'>Login with Google</a></div>
            </div>
        )
    }
}
